import styles from "./UiMenu.module.scss";
console.log(styles);
export function UiMenu() {
  const ui_menu = [
    {
      title: "Новости",
      class: `${styles.menu_list} ${styles.news}`,
      btn: {
        block1: {
          class: styles.extra_label,
          img: {
            class: styles.menu_wrap,
            url: "/public/ico/narrow_column/ui_munu-menu.svg",
            alt: "menu",
          },
        },
        block2: {
          class: styles.right_icon,
          img: {
            class: styles.right_icon,
            url: "/public/ico/narrow_column/ui_menu-right_icon.svg",
            alt: "right_icon",
          },
        },
      },
      list: {
        class: styles.news_list,
        link1: { href: "#", class: `${styles.menu_list} ${styles.foto}`, title: "Фотографии" },
        link2: {
          href: "#",
          class: `${styles.menu_list} ${styles.friends}`,
          title: "Друзья",
        },
      },
      sep: "",
    },
    { title: "Рекомендации", class: `${styles.menu_list} ${styles.recommended}`, sep: "" },
    { title: "", class: "", btn: [], list: [], sep: "" },
    { title: "", class: "", btn: [], list: [], sep: "" },
    { title: "", class: "", btn: [], list: [], sep: "" },
    { title: "", class: "", btn: [], list: [], sep: "" },
  ];
  return (
    <div className={styles.ui_menu}>
      <a href="#" className={`${styles.menu_list} ${styles.news}`}>
        Новости
        <div className={styles.extra_label}>
          <div className={styles.menu_wrap}>
            <img src="/public/ico/narrow_column/ui_munu-menu.svg" alt="" />
          </div>
          <div className={styles.right_icon}>
            <img src="/public/ico/narrow_column/ui_menu-right_icon.svg" alt="" />
          </div>
        </div>
      </a>
      <div className={styles.news_list}>
        <a href="#" className={`${styles.menu_list} ${styles.foto}`}>
          Фотографии
        </a>
        <a href="#" className={`${styles.menu_list} ${styles.friends}`}>
          Друзья
        </a>
      </div>
      <a href="#" className={`${styles.menu_list} ${styles.recommended}`}>
        Рекомендации
      </a>
      <a href="#" className={`${styles.menu_list} ${styles.search}`}>
        Поиск
      </a>
      <div className={styles.sep}></div>
      <a href="#" className={`${styles.menu_list}`}>
        Реакции
      </a>
      <a href="#" className={`${styles.menu_list}`}>
        Обновления
      </a>
      <a href="#" className={`${styles.menu_list}`}>
        Комментарии
      </a>
    </div>
  );
}
